owned = set([line.strip() for line in owned_text.splitlines() if line.strip()])
desired = set([line.strip() for line in desired_text.splitlines() if line.strip()])

# Normalize basic lands
def normalize(card):
    basics = ["Plains", "Island", "Swamp", "Mountain", "Forest"]
    if card in basics:
        return "BasicLandPlaceholder_" + card
    return card

owned_norm = set(normalize(c) for c in owned)
desired_norm = set(normalize(c) for c in desired)

missing_norm = sorted(list(desired_norm - owned_norm))

# Convert back basics
missing = [c.replace("BasicLandPlaceholder_", "") for c in missing_norm]

